import React, { Component } from "react";
import * as ReactBoostrap from 'react-bootstrap';
import { Button } from './Buttons.js';
import { Linik } from 'react-router-dom';
import './Tarjeta.css';
import '../App.js';

export default class Tarjeta extends Component {

    constructor() {
        super();
        this.state = {
        }
    }

    render() {
        return (
            <div className='divBlanco'>
                <div class="card-group">
                    <div class="card">
                        <img class="card-img-top" src="/images/img-1.jpg" alt="Card image cap" />
                        <div class="card-body">
                            <h5 class="card-title">FRENOS</h5>
                            <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                            <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                        </div>
                    </div>
                    <div class="card">
                        <img class="card-img-top" src="/images/img-2.jpg" alt="Card image cap" />
                        <div class="card-body">
                            <h5 class="card-title">ALINEACION Y BALANCEO</h5>
                            <p class="card-text">This card has supporting text below as a natural lead-in to additional content.</p>
                            <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                        </div>
                    </div>
                    <div class="card">
                        <img class="card-img-top" src="/images/img-3.jpg" alt="Card image cap" />
                        <div class="card-body">
                            <h5 class="card-title">CAMBIO DE ACEITE Y FILTROS</h5>
                            <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This card has even longer content than the first to show that equal height action.</p>
                            <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                        </div>
                    </div>
                </div>
            </div>
        );

    }
}
